exports=async function(bid,options){const{parseCatalog,cleanCatalogWrapper,hrefRecordRegex}=await require("transcode/parse_catalog");return parseCatalog(`http://www.bookshuku.com/read/${bid}.html`,{cleaner:html=>cleanCatalogWrapper(html,/class="read_list"[^>]*>/,"</div>"),recordRegex:hrefRecordRegex},{clientOptions:{...(options&&options.clientOptions)}})};